import React,{Component} from 'react';
import './App.css';

const App = () => {
  return (
    <div>
      <Appa />
      <Pepi />
    </div>
  );
}

const Pepi = () => {
  return(
    <div>
    <p>
      StonksULTRAMEGA
      </p>  
    </div>
  )
}

const Appa = () =>{
  return (
    <div>
    <p>kamasutra</p>

    <header className='App-header'>

      <ul>
    <li>1</li>
    <li>2</li>
      </ul> 
      <p>
        Edit <code>src/App.js</code> and save to reload. sumatra
      </p>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Learn React
      </a>
    </header>
    </div>
  );
}

export default App;
